import React, { useState, useContext, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { AuthContext } from '../contexts/AuthContext';
import '../App.css';

const ComplainSubmit = () => {
  const { authData } = useContext(AuthContext);
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    complaintType: '',
    description: '',
    userId: authData?.user?.userID || '',
    mobile: authData?.user?.mobileNumber || '',
    email: authData?.user?.emailID || '',
    geoLocation: authData?.user?.geoLocation || '',
    document: null,
    photo: null,
  });

  useEffect(() => {
    if (authData) {
      setFormData((prevData) => ({
        ...prevData,
        userId: authData.user.userID || '',
        mobile: authData.user.mobileNumber || '',
        email: authData.user.emailID || '',
        geoLocation: authData.user.geoLocation || '',
      }));
    }
  }, [authData]);


  const handleFileChange = (e) => {
    const { name, files } = e.target;
    setFormData({ ...formData, [name]: files[0] });
  };

  const fetchLocation = () => {
    navigator.geolocation.getCurrentPosition(
      (position) => {
        setFormData((prevData) => ({
          ...prevData,
          geoLocation: `${position.coords.latitude}, ${position.coords.longitude}`,
        }));
      },
      (error) => {
        alert(`Error fetching location: ${error.message}`);
      }
    );
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const submitFiles = new FormData();
    if (formData.document) submitFiles.append('attachmentDoc', formData.document);
    if (formData.photo) submitFiles.append('userImage', formData.photo);
    submitFiles.append('userId', formData.userId);

    try {
      console.log('Uploading files...');
      const fileUploadResponse = await axios.post(
        'https://babralaapi-d3fpaphrckejgdd5.centralindia-01.azurewebsites.net/auth/submitFiles',
        submitFiles,
        { headers: { 'Content-Type': 'multipart/form-data' } }
      );

      if (fileUploadResponse.data.success) {
        const submitComplaint = {
          colony: 'Colony 1A',
          complaintStatus: 'Open',
          complaintType: formData.complaintType,
          createdBy: 'user',
          createdDate: new Date().toISOString(),
          description: formData.description,
          ipAddress: '49.36.186.235',
          locality: 'Locality Ward 1',
          localityID: 1,
          location: formData.geoLocation,
          mobileNumber: formData.mobile,
          userID: formData.userId,
          zone: 'North',
          zoneID: 1,
          documentUrl: fileUploadResponse.data.attachmentDocUrl,
          photoUrl: fileUploadResponse.data.userImageUrl,
        };

        console.log('Submitting complaint...');
        const complaintResponse = await axios.post(
          'https://babralaapi-d3fpaphrckejgdd5.centralindia-01.azurewebsites.net/auth/complaints',
          submitComplaint,
          { headers: { 'Content-Type': 'application/json' } }
        );

        if (complaintResponse.data.success) {
          alert('Complaint Submitted Successfully');
          navigate('/Home', { state: { userId: formData.userId } });
        }
      } else {
        alert('File Upload Error: ' + fileUploadResponse.data.message);
      }
    } catch (error) {
      let errorMessage = 'Something went wrong!';
      if (error.response) errorMessage = error.response.data?.message || `Error ${error.response.status}`;
      else if (error.request) errorMessage = 'No response from server.';
      else errorMessage = error.message;
      alert(errorMessage);
    }
  };

  return (
    <div className="complain">
      <div className="formContainer">
        <h1>Submit Complaint</h1>
        <form onSubmit={handleSubmit}>
          <input type="text" name="geoLocation" value={formData.geoLocation} readOnly />
          <button type="button" onClick={fetchLocation}>Refresh Location</button>
          <input type="file" name="document" onChange={handleFileChange} />
          <input type="file" name="photo" onChange={handleFileChange} />
          <button type="submit">Submit Complaint</button>
        </form>
      </div>
    </div>
  );
};

export default ComplainSubmit;
